import React from 'react';

// Correctly define styles as objects
const iframeContainerStyle = {
  left: 0,
  width: "100%",
  height: "800px",
  position: "relative",
  border: "0"
};

const iframeStyle = {
  top: 0,
  left: 0,
  width: "100%",
  height: "100%",
  position: "absolute",
  border: 'none'
};

function TikTokEmbed({ videoId }) {
  const url = `https://www.tiktok.com/embed/${videoId}`;
  return (
    <div style={iframeContainerStyle}>
      <iframe
        src={url}
        style={iframeStyle}
        allowFullScreen
        scrolling="no"
        width="100%"
        height="100%"
        allow="encrypted-media;"
      ></iframe>
    </div>
  );
}

export default TikTokEmbed;
